import img from '../Assets/image.png';
function App() {
    return (
      <div className="App w-[100vw] h-[96vh] flex items-center gap-[1vh] justify-center  overflow-y-auto">
            <div className="w-[45vw] h-[50vh] bordertest flex flex-col justify-center items-end gap-[1vw]">
                <div className='w-[43vw] h-[4vh] bordertest flex items-center abtheader'>
                    Offers
                </div>
                <div className='w-[43vw] h-[4vh] bordertest flex items-center prsnl'>
                    Personal Training
                </div>
            </div>
            <div className="w-[35vw] h-[60vh] bordertest imgcontainer rounded-lg overflow-hidden flex justify-center items-center cursor-pointer">
                <img src={img}></img>
            </div>
      </div>
    );
  }
  
export default App;
